    [],nt"revision_timestamp": "2016-07-27T23:06:18.910574",nt"name": "the-ecology-of-a-boggy-marsh-in-stafford-county-kansas",nt"isopen":
    false,nt"url": null,nt"notes": "The fluctuating water level of lakes and
    ponds is one of the most critical factors in the establishment of aquatic vegetation
    in Kansas. This study utilizes an artesian-fed marsh ( Fig. 1) in which the amplitude
    of water level is reduced, making possible the investigation of other factors that
    contribute to plant zonation. Objectives of this study, conducted from March, 1957,
    to August, 1958, may be summarized as follows: 1. To establish patterns of zonation
    of seed plants in this marsh. 2. To study certain chemical and physical factors
    in the water supply and the changes in these factors at 13 selected stations. 3.
    To investigate relationships between various plant and animal species and between
    these species and environmental factors.",nt"license_title": "License Not
